import React from "react";

import { Container, Content } from "./styles";
import AndroidIcon from "@mui/icons-material/Android";
import { Formik, Form, ErrorMessage } from "formik";
import DefaultInput from "../../components/DefaultInput";
const Scheduling = () => {
  const loginSchema = Yup.object().shape({
    name: Yup.string().required("Nome é um campo obrigatório"),
    surname: Yup.string().required("Sobrenome é um campo obrigatório"),
    email: Yup.string().required("Email é um campo obrigatório").email(),
    password: Yup.string()
      .required("Password é um campo obrigatório")
      .min(6, "Password em formato inválido"),
  });

  return (
    <Container>
      <Content>
        <AndroidIcon />
        <h4>Agendamentos</h4>
        <h4> Bem Vindo ao Agendamento </h4>
        <Formik
          validationSchema={loginSchema}
          initialValues={{ name: "", surname: "", email: "", password: "" }}
          onSubmit={async ({ name, surname, email, password }) => {
            try {
            } catch (err) {}
          }}
        >
          {({ values, errors, touched, handleSubmit, handleChange }) => (
            <Form noValidate onSubmit={handleSubmit}>
              <DefaultInput
                customPadding="10px"
                customMarginTop="0px"
                type="name"
                name="name"
                onChange={handleChange}
                value={values.name}
                placeHolder="Nome completo"
                id="name"
              />

              <ErrorMessage>
                {errors.name != null && touched.name != null && errors.name}
              </ErrorMessage>

              <DefaultInput
                customPadding="10px"
                customMarginTop="0px"
                type="email"
                name="email"
                onChange={handleChange}
                value={values.email}
                placeHolder="Email"
                id="email"
              />

              <ErrorMessage>
                {errors.email != null && touched.email != null && errors.email}
              </ErrorMessage>
              <DefaultInput
                customPadding="10px"
                customMarginTop="0px"
                type="password"
                name="password"
                onChange={handleChange}
                value={values.password}
                placeHolder="Senha"
                id="password"
              />

              <ErrorMessage>
                {errors.password != null &&
                  touched.password != null &&
                  errors.password}
              </ErrorMessage>

              <DefaultButton
                customBackgroundColor="#04D361"
                type="submit"
                marginTop="16px"
                opacity={0.8}
                onClick={handleSubmit}
              >
                Finalizar Cadastro
              </DefaultButton>
            </Form>
          )}
        </Formik>
      </Content>
    </Container>
  );
};

export default Scheduling;
